import React from 'react';
import UserLayout from "../../../packages/userLayout/UserLayout";
import NewsletterEmailsList from "../../newsletter/list/components/NewsletterEmailsList";
import DeleteModal from "../../recipes/userProfileList/components/DeleteModal";

const ContactsList = props => {
    return (
        <div className="page_wrapper">
            <UserLayout>
                <NewsletterEmailsList
                    toggleDeleteModal={toggleDeleteModal}
                    emails={emails}
                />
                {success && (
                    <p style={{ textAlign: "right" }} className="success">
                        {success}
                    </p>
                )}
            </UserLayout>
            {isOpenDeleteModal === true && (
                <DeleteModal
                    isModalOpen={isOpenDeleteModal}
                    closeModal={() => toggleDeleteModal(selectedEmailToDelete)}
                    deleteTask={() => deleteEmail(selectedEmailToDelete)}
                />
            )}
        </div>
    );
};

export default ContactsList;
